<script setup lang="ts">
import { ALBUMS } from './albums/albums';
import { onMounted, ref } from 'vue';

const album = ref(0)
const track = ref(0)
const play = ref(false)
const player = ref(null)

const playTrack = () => {
  play.value = false

  play.value = true
}

const playParticularTrack = (albumValue, trackValue) => {
  album.value = ALBUMS.indexOf(albumValue)
  track.value = albumValue.tracks.indexOf(trackValue)
  playTrack()
}

const isCurrentTrack = (albumValue, trackValue) => {
  return album.value === ALBUMS.indexOf(albumValue) && track.value === albumValue.tracks.indexOf(trackValue)
}

const next = () => {
  track.value++
  if (!ALBUMS[album.value].tracks[track.value]) {
    album.value++
    if (!ALBUMS[album.value]) {
      album.value = 0
    }
    track.value = 0
  }
  playTrack()
}

const prev = () => {
  track.value--
  if (!ALBUMS[album.value].tracks[track.value]) {
    album.value--
    if (!ALBUMS[album.value]) {
      album.value = 0
    }
    track.value = 0
  }


  playTrack()
}

onMounted(() => {
  play.value = true
})
</script>

<template>
  <header>
    <h1 class="header-text rock-3d-regular">Z-FUNK FREE RADIO</h1>
  </header>
  <main class="main-content">
    <div class="main-left">
      <section class="player">
        <img :src="ALBUMS[album].cover" class="album-cover-player" />

        <audio class="audio" v-if="play && ALBUMS[album]?.tracks[track]" ref="player" id="audio"
          :src="ALBUMS[album].tracks[track].audio" controls autoplay v-on:ended="next"></audio>
        <div class="player-track-title">
          <div>{{ ALBUMS[album].tracks[track].artist }}</div>
          <div class="title-controls">
            <img src="/public/play-next.svg" class="play-prev-next prev"
              :class="album === 0 && track === 0 ? 'disabled' : ''" alt="prev" @click="prev" /><strong>{{
                ALBUMS[album].tracks[track].title }}</strong><img src="/public/play-next.svg" class="play-prev-next"
              alt="next" @click="next" />
          </div>
        </div>
      </section>
    </div>
    <div class="main-right">

      <template v-for="(currentAlbum, i) in ALBUMS" :key="`album${i}`">
        <section class="albums">
          <h4 class="albums-main">{{ currentAlbum.artist }} - {{ currentAlbum.title }}</h4>
          <div class="album">
            <img :src="currentAlbum.cover" class="album-cover" />
            <div>
              <div v-for="(currentTrack, k) in currentAlbum.tracks" :key="`album${i}track${k}`" @click="() => {
                playParticularTrack(currentAlbum, currentTrack)
              }">
                <div :class="isCurrentTrack(currentAlbum, currentTrack) ? 'track-title active' : 'track-title'">{{ k + 1
                  }}. {{ currentTrack.artist }} - {{ currentTrack.title }}
                  <img v-if="isCurrentTrack(currentAlbum, currentTrack)" src="/public/play-button.svg"
                    class="track-play-icon" />

                </div>
              </div>
            </div>
          </div>
        </section>
      </template>

    </div>
  </main>



</template>

